import React from "react";
import "bootstrap/dist/css/bootstrap.min.css";

function Jumbotron() {
    return (
        <Jumbotron>
            <h1>SAIO</h1>
            <p>
                Our Student All-In-One Project
            </p>
        </Jumbotron>
    );
}

export default Jumbotron;
